    def clicked_btn(self):
        w = self.tableWidget.baseSize().width()
        _translate = QtCore.QCoreApplication.translate
        tr = 0

        while True:
            item = self.tableWidget.item(tr, 0)
            if tr == w + 1:
                self.tableWidget.setBaseSize(QtCore.QSize(w + 1, w + 1))
                self.tableWidget.setRowCount(w + 3)
                item = QtWidgets.QTableWidgetItem()
                self.tableWidget.setVerticalHeaderItem(w + 2, item)
                item = QtWidgets.QTableWidgetItem()
                item.setTextAlignment(QtCore.Qt.AlignCenter)
                self.tableWidget.setItem(w + 1, 0, item)
                item = QtWidgets.QTableWidgetItem()
                item.setTextAlignment(QtCore.Qt.AlignCenter)
                self.tableWidget.setItem(w + 1, 1, item)
                item = self.tableWidget.item(tr, 0)
                item.setText(_translate("ATTH", self.textEdit.toPlainText()))
                item = self.tableWidget.item(tr, 1)
                if self.textEdit.toPlainText() == "":
                    item.setText(_translate("ATTH", ""))
                else:
                    item.setText(
                        _translate("ATTH", self.doubleSpinBox.text() + " ml, " + self.doubleSpinBox_2.text() + "μl/s"))
                item = self.tableWidget.verticalHeaderItem(w + 1)
                item.setText(_translate("ATTH", str(w + 2)))
                break
            if item.tableWidget().item(tr, 0).text() != "":
                tr = tr + 1
            else:
                item = self.tableWidget.item(tr, 0)
                item.setText(_translate("ATTH", self.textEdit.toPlainText()))
                item = self.tableWidget.item(tr, 1)
                if self.textEdit.toPlainText() == "":
                    item.setText(_translate("ATTH", ""))
                else:
                    item.setText(
                        _translate("ATTH", self.doubleSpinBox.text() + " ml, " + self.doubleSpinBox_2.text() + "μl/s"))
                break

    def clicked_btn_clear1(self):
        w = self.tableWidget.baseSize().width()
        _translate = QtCore.QCoreApplication.translate
        item = self.tableWidget.item(w, 0)
        item.setText(_translate("ATTH", ""))
        item = self.tableWidget.item(w, 1)
        item.setText(_translate("ATTH", ""))
        t = 0

        while True:
            if item.tableWidget().item(0, 0).text() == "":
                break
            if item.tableWidget().item(t, 0).text() != "":
                t = t + 1
            else:
                break
        if t == 1:
            t = 0
        else:
            if item.tableWidget().item(0, 0).text() != "":
                if w > t:
                    t = t - 1
        z = 0
        if t <= 0:
            t = 1
            z = 1
        if z != 1:
            self.tableWidget.setBaseSize(QtCore.QSize(t - 1, t - 1))
            self.tableWidget.setRowCount(t)
            self.tableWidget.setRowCount(t + 1)
        else:
            self.tableWidget.setBaseSize(QtCore.QSize(0, 0))
            self.tableWidget.setRowCount(1)
            if (int(self.tableWidget.rowCount()) == 1) and (w == 3):
                item = self.tableWidget.item(0, 0)
                item.setText(_translate("ATTH", ""))
                item = self.tableWidget.item(0, 1)
                item.setText(_translate("ATTH", ""))
            self.tableWidget.setRowCount(2)

        item = QtWidgets.QTableWidgetItem()
        self.tableWidget.setVerticalHeaderItem(t, item)
        item = QtWidgets.QTableWidgetItem()
        item.setTextAlignment(QtCore.Qt.AlignCenter)

